  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Potomac
  River National Wildlife Refuge Complex outlines Refuge accomplishments during the
  2000 calendar year. The report begins with a summary of the years' highlights and
  weather conditions. Land acquisition is covered. The report includes a planning
  section which discusses the master plan, and research and investigations. Refuge
  administration is outlined; information about personnel, youth programs, volunteer
  programs, funding, safety, and technical assistance is given. Habitat management
  is also covered; subjects include wetlands, forests, grasslands, and fire management.
  The wildlife section of the report discusses wildlife diversity, endangered and
  threatened species, waterfowl, marsh birds and waterbirds, game mammals, and marking
  and bird banding. The public uses of the Refuge described in this report include
  outdoor classrooms, interpretive programs, hunting, and law enforcement. The equipment
  and facilities section of the report provides information about new construction,
  rehabilitation, major maintenance, equipment utilization and replacement, communications
  systems, and energy conservation.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
